import { Switch, Route } from "react-router-dom";
import Cadastrar from "./Cadastrar"
import {Routes} from 'react-router-dom';

export default () => {
    return(
        <Routes>
            <Route exec path="/">
                <div>a</div>
            </Route>

            <Route exec path="/cadastrar">
                <Cadastrar></Cadastrar>
            </Route>
        </Routes>
    )
}
